INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ミヤコ（クリスマス）", "2023/12/22 12:00:00", 1, 0, 2.17, 14, 1, "みやこ", 0, 119901, 0, 119901, 3, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 1, 0, 119901, 1, 119901, 302, 0, 450, 0, "2023/12/27 11:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("シズル（ノワール）", "2024/03/22 12:00:00", 1, 0, 2.375, 6, 1, "しずる", 0, 120001, 0, 120001, 3, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 5, 0, 120001, 5, 120001, 190, 0, 450, 0, "2024/03/28 11:59:59");
