INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("シェフィ（ニューイヤー）", "2024/01/26 12:00:00", 1, 0, 1.84, 1, 1, "しぇふぃ", 0, 120701, 0, 120701, 3, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", 4, 0, 120701, 22, 120701, 283, 0, 450, 0, "2024/01/31 11:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ルカ（ニューイヤー）", "2023/10/16 15:00:00", 1, 0, 1.3, 2, 1, "るか", 0, 120801, 0, 120801, 1, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", 4, 0, 120801, 22, 120801, 193, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("イリヤ（ニューイヤー）", "2024/01/26 12:00:00", 1, 0, 1.425, 12, 2, "いりや", 0, 120901, 0, 120901, 3, "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", 3, 0, 120901, 38, 120901, 424, 0, 450, 0, "2024/01/31 11:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ペコリーヌ（オーバーロード）", "2024/02/22 12:00:00", 1, 0, 2.25, 1, 1, "ぺこりーぬ", 0, 121001, 0, 121001, 3, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 5, 0, 121001, 41, 121001, 164, 0, 450, 0, "2024/02/29 11:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("キャル（オーバーロード）", "2024/02/22 12:00:00", 1, 0, 2.07, 1, 2, "きゃる", 0, 121101, 0, 121101, 3, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 7, 0, 121101, 42, 121101, 588, 0, 450, 0, "2024/02/29 11:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ラビリスタ（オーバーロード）", "2023/11/16 15:00:00", 1, 0, 1.55, 6, 1, "らびりすた", 0, 121201, 0, 121201, 1, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 4, 0, 121201, 40, 121201, 260, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("クルミ（ステージ）", "2022/03/03 19:00:00", 0, 0, 1.9, 3, 1, "くるみ", 0, 121301, 0, 121301, 3, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 3, 0, 121301, 3, 121301, 731, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ミサキ（ステージ）", "2022/03/15 15:00:00", 0, 0, 2.27, 15, 2, "みさき", 0, 121401, 0, 121401, 3, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 7, 0, 121401, 7, 121401, 742, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("アユミ（怪盗）", "2024/04/12 12:00:00", 1, 0, 2.0, 12, 1, "あゆみ", 0, 121501, 0, 121501, 3, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 6, 0, 121501, 6, 121501, 590, 0, 450, 0, "2024/04/15 14:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("イノリ（怪盗）", "2022/04/15 15:00:00", 0, 0, 1.425, 17, 1, "いのり", 0, 121601, 0, 121601, 3, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 3, 0, 121601, 3, 121601, 292, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("アキノ（アキノ＆サレン）", "2015/04/01 15:00:00", 1, 0, 0.0, 0, 0, "あきの", 0, 121701, 0, 0, 3, "", 0, 1, 0, 0, 121701, 421, 0, 0, 180901, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("サレン（アキノ＆サレン）", "2015/04/01 15:00:00", 1, 0, 0.0, 0, 0, "されん", 0, 121801, 0, 0, 3, "", 0, 1, 0, 0, 121801, 421, 0, 0, 180901, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("アンナ（パイレーツ）", "2022/05/15 15:00:00", 0, 0, 2.125, 12, 2, "あんな", 0, 121901, 0, 121901, 3, "【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。", 5, 0, 121901, 5, 121901, 293, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("シノブ（パイレーツ）", "2022/05/03 19:00:00", 0, 0, 1.425, 14, 1, "しのぶ", 0, 122001, 0, 122001, 3, "【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", 3, 0, 122001, 3, 122001, 380, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("アオイ（キャンプ）", "2024/04/18 15:00:00", 1, 0, 1.97, 9, 1, "あおい", 0, 122101, 0, 122101, 1, "【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", 35, 0, 122101, 35, 122101, 731, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ユカリ（キャンプ）", "2022/05/31 12:00:00", 0, 0, 1.84, 8, 1, "ゆかり", 0, 122201, 0, 122201, 3, "【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", 4, 0, 122201, 4, 122201, 419, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ヴァンピィ", "2022/06/15 15:00:00", 0, 0, 1.425, 0, 2, "うぁんぴぃ", 0, 122301, 0, 122301, 3, "【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", 43, 0, 122301, 43, 122301, 564, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ヒヨリ（サマー）", "2024/06/17 15:00:00", 1, 0, 2.42, 8, 1, "ひより", 0, 122401, 0, 122401, 1, "【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", 1, 0, 122401, 1, 122401, 264, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("レイ（サマー）", "2023/07/12 12:00:00", 1, 0, 1.965, 0, 1, "れい", 0, 122501, 0, 122501, 3, "【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", 4, 0, 122501, 4, 122501, 250, 0, 450, 0, "2023/07/15 14:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ユイ（サマー）", "2022/07/15 15:00:00", 0, 0, 2.27, 0, 2, "ゆい", 0, 122601, 0, 122601, 3, "【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", 7, 0, 122601, 7, 122601, 554, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("キョウカ（サマー）", "2022/08/15 15:00:00", 0, 0, 1.92, 0, 2, "きょうか", 0, 122701, 0, 122701, 3, "【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", 7, 0, 122701, 7, 122701, 812, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ミソギ（サマー）", "2024/07/16 15:00:00", 1, 0, 2.295, 0, 1, "みそぎ", 0, 122801, 0, 122801, 1, "【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", 1, 0, 122801, 1, 122801, 237, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ミミ（サマー）", "2023/08/09 12:00:00", 1, 0, 2.25, 0, 1, "みみ", 0, 122901, 0, 122901, 3, "【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", 5, 0, 122901, 5, 122901, 361, 0, 450, 0, "2023/08/12 11:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("アメス", "2024/06/30 12:00:00", 1, 0, 2.27, 0, 2, "あめす", 0, 123001, 0, 123001, 3, "【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", 44, 0, 123001, 44, 123001, 746, 0, 450, 0, "2024/07/03 18:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("マホ（エクスプローラー）", "2022/09/03 19:00:00", 0, 0, 1.795, 0, 2, "まほ", 0, 123101, 0, 123101, 3, "【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", 7, 0, 123101, 7, 123101, 793, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("アヤネ（エクスプローラー）", "2022/09/15 15:00:00", 0, 0, 1.425, 0, 1, "あやね", 0, 123201, 0, 123201, 3, "【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", 3, 0, 123201, 3, 123201, 256, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ネア", "2023/09/12 12:00:00", 1, 0, 1.62, 0, 1, "ねあ", 0, 123301, 0, 123301, 3, "【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", 1, 0, 123301, 0, 123301, 350, 0, 450, 0, "2023/09/15 14:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ジュン（キャンプ）", "2015/04/01 15:00:00", 0, 0, 0.0, 0, 0, "じゅん", 0, 123401, 0, 0, 3, "", 5, 0, 0, 5, 123401, 0, 0, 0, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("リン（ハロウィン）", "2022/09/30 12:00:00", 1, 0, 2.34, 0, 1, "りん", 0, 123501, 0, 123501, 1, "【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。", 6, 1, 123501, 6, 123501, 583, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("トモ（ハロウィン）", "2023/10/10 12:00:00", 1, 0, 1.965, 0, 1, "とも", 0, 123601, 0, 123601, 3, "【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", 4, 0, 123601, 4, 123601, 262, 0, 450, 0, "2023/10/15 14:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ナナカ（ハロウィン）", "2022/10/15 15:00:00", 0, 0, 2.07, 0, 2, "ななか", 0, 123701, 0, 123701, 3, "【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", 7, 0, 123701, 21, 123701, 741, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("クリスティーナ（ワイルド）", "2023/11/10 12:00:00", 1, 0, 2.295, 0, 1, "くりすてぃーな", 0, 123801, 0, 123801, 3, "【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", 1, 0, 123801, 1, 123801, 238, 0, 450, 0, "2023/11/15 14:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("マツリ（ワイルド）", "2022/11/15 15:00:00", 0, 0, 2.125, 0, 1, "まつり", 0, 123901, 0, 123901, 3, "【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", 2, 0, 123901, 2, 123901, 183, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("アカリ（クリスマス）", "2023/12/11 12:00:00", 1, 0, 2.07, 0, 2, "あかり", 0, 124001, 0, 124001, 3, "【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", 7, 0, 124001, 7, 124001, 438, 0, 450, 0, "2023/12/15 14:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ヨリ（クリスマス）", "2022/11/30 12:00:00", 1, 0, 1.965, 0, 2, "より", 0, 124101, 0, 124101, 1, "【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", 6, 1, 124101, 6, 124101, 433, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ジュン（クリスマス）", "2022/12/23 12:00:00", 0, 0, 2.07, 0, 1, "じゅん", 0, 124201, 0, 124201, 3, "【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", 5, 0, 124201, 5, 124201, 144, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("アン（アン＆グレア）", "2015/04/01 15:00:00", 1, 0, 0.0, 0, 0, "あん", 0, 124301, 0, 0, 3, "", 0, 1, 0, 0, 124301, 577, 0, 0, 181001, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("グレア（アン＆グレア）", "2015/04/01 15:00:00", 1, 0, 0.0, 0, 0, "ぐれあ", 0, 124401, 0, 0, 3, "", 0, 1, 0, 0, 124401, 577, 0, 0, 181001, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ホマレ（ニューイヤー）", "2024/01/12 12:00:00", 1, 0, 2.07, 0, 2, "ほまれ", 0, 124501, 0, 124501, 3, "【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", 7, 0, 124501, 21, 124501, 707, 0, 450, 0, "2024/01/15 14:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ミサト（ニューイヤー）", "2024/01/12 12:00:00", 1, 0, 2.44, 0, 2, "みさと", 0, 124601, 0, 124601, 3, "【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", 7, 0, 124601, 21, 124601, 698, 0, 450, 0, "2024/01/15 14:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ミツキ（ニューイヤー）", "2022/12/31 12:00:00", 1, 0, 2.24, 0, 1, "みつき", 0, 124701, 0, 124701, 1, "【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", 7, 1, 124701, 46, 124701, 590, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ノゾミ（リベレイター）", "2024/02/12 12:00:00", 1, 0, 2.14, 0, 1, "のぞみ", 0, 124801, 0, 124801, 3, "【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", 4, 0, 124801, 0, 124801, 423, 0, 450, 0, "2024/02/14 23:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("カヤ（リベレイター）", "2023/01/31 12:00:00", 1, 0, 1.965, 0, 1, "かや", 0, 124901, 0, 124901, 1, "【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", 1, 1, 124901, 0, 124901, 170, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ムイミ（リベレイター）", "2024/02/12 12:00:00", 1, 0, 1.965, 0, 1, "むいみ", 0, 125001, 0, 125001, 3, "【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", 5, 0, 125001, 0, 125001, 221, 0, 450, 0, "2024/02/14 23:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("タマキ（カフェ）", "2023/03/03 19:00:00", 0, 0, 2.24, 0, 1, "たまき", 0, 125101, 0, 125101, 3, "【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", 8, 0, 125101, 47, 125101, 825, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("モニカ（カフェ）", "2023/03/10 12:00:00", 0, 0, 1.965, 0, 1, "もにか", 0, 125201, 0, 125201, 3, "【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", 4, 0, 125201, 4, 125201, 463, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("コッコロ（レンジャー）", "2024/04/12 12:00:00", 1, 0, 2.07, 0, 1, "こっころ", 0, 125301, 0, 125301, 3, "【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", 6, 0, 125301, 6, 125301, 752, 0, 450, 0, "2024/04/15 14:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("シオリ（レンジャー）", "2023/04/10 12:00:00", 0, 0, 2.09, 0, 1, "しおり", 0, 125401, 0, 125401, 3, "【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", 8, 0, 125401, 8, 125401, 710, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ジータ（ウォーロック）", "2024/05/10 12:00:00", 1, 0, 1.92, 0, 2, "じーた", 0, 125501, 0, 125501, 3, "【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", 7, 0, 125501, 50, 125501, 443, 0, 450, 0, "2024/05/15 14:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ビカラ", "2024/05/10 12:00:00", 1, 0, 2.09, 0, 1, "びから", 0, 125601, 0, 125601, 3, "【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", 51, 0, 125601, 0, 125601, 267, 0, 450, 0, "2024/05/15 14:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("カリン（アルケミスト）", "2023/04/30 12:00:00", 1, 0, 2.24, 0, 2, "かりん", 0, 125701, 0, 125701, 1, "【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", 7, 1, 125701, 9, 125701, 579, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("リリ（フォールン）", "2023/04/17 12:00:00", 0, 0, 2.09, 0, 1, "りり", 0, 125801, 0, 125801, 3, "【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", 3, 0, 125801, 0, 125801, 464, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("カヤ（リベレイター）", "2015/04/01 15:00:00", 1, 0, 0.0, 0, 0, "かや", 0, 125901, 0, 0, 3, "", 1, 0, 0, 1, 125901, 0, 0, 0, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("クリア（フォールン）", "2023/10/31 12:00:00", 0, 0, 2.09, 0, 1, "くりあ", 0, 126001, 0, 126001, 3, "【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", 0, 0, 126001, 0, 126001, 406, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("プレシア（フォールン）", "2023/11/15 15:00:00", 0, 0, 2.09, 0, 2, "ぷれしあ", 0, 126101, 0, 126101, 3, "【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", 44, 0, 126101, 53, 126101, 480, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("イリヤ（儀装束）", "2024/06/10 12:00:00", 1, 0, 2.09, 0, 2, "いりや", 0, 126201, 0, 126201, 3, "【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", 3, 0, 126201, 3, 126201, 568, 0, 450, 0, "2024/06/15 14:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ユキ（儀装束）", "2023/06/15 15:00:00", 0, 0, 2.07, 0, 2, "ゆき", 0, 126301, 0, 126301, 3, "【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", 7, 0, 126301, 9, 126301, 456, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("クローチェ", "2024/06/30 12:00:00", 1, 0, 2.09, 0, 1, "くろーちぇ", 0, 126401, 0, 126401, 3, "【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", 1, 0, 126401, 1, 126401, 373, 0, 450, 0, "2024/07/03 18:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ライラエル", "2024/06/30 12:00:00", 1, 0, 1.965, 0, 2, "らいらえる", 0, 126501, 0, 126501, 3, "【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", 7, 0, 126501, 0, 126501, 740, 0, 450, 0, "2024/07/03 18:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ネネカ（サマー）", "2024/07/11 12:00:00", 1, 0, 2.04, 0, 2, "ねねか", 0, 126601, 0, 126601, 3, "【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", 7, 0, 126601, 7, 126601, 650, 0, 450, 0, "2024/07/15 14:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("アキノ（サマー）", "2023/06/30 12:00:00", 1, 0, 1.965, 0, 1, "あきの", 0, 126701, 0, 126701, 1, "【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", 5, 1, 126701, 5, 126701, 224, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ユカリ（サマー）", "2023/07/15 15:00:00", 0, 0, 1.97, 0, 1, "ゆかり", 0, 126801, 0, 126801, 3, "【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", 5, 0, 126801, 5, 126801, 159, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ランファ（サマー）", "2024/08/09 12:00:00", 1, 0, 1.965, 0, 2, "らんふぁ", 0, 126901, 0, 126901, 3, "【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", 7, 0, 126901, 21, 126901, 682, 0, 450, 0, "2024/08/12 11:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("クウカ（サマー）", "2023/07/31 12:00:00", 1, 0, 1.97, 0, 1, "くうか", 0, 127001, 0, 127001, 1, "【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", 2, 1, 127001, 52, 127001, 133, 0, 450, 0, "2023/08/14 20:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("シノブ（サマー）", "2024/08/09 12:00:00", 1, 0, 2.09, 0, 1, "しのぶ", 0, 127101, 0, 127101, 3, "【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", 5, 0, 127101, 46, 127101, 255, 0, 450, 0, "2024/08/12 11:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("キャル（編入生）", "2024/03/28 12:00:00", 1, 0, 2.09, 0, 2, "きゃる", 0, 127201, 0, 127201, 3, "【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", 7, 0, 127201, 7, 127201, 804, 0, 450, 0, "2024/03/31 11:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("スズナ（編入生）", "2023/09/15 15:00:00", 0, 0, 2.09, 0, 1, "すずな", 0, 127301, 0, 127301, 3, "【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", 8, 0, 127301, 8, 127301, 750, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ビカラ（コラボ）", "2015/04/01 15:00:00", 1, 0, 0.0, 0, 0, "びから", 0, 127401, 0, 0, 3, "", 1, 0, 0, 1, 127401, 0, 0, 0, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("サレン（サラサリア）", "2024/04/26 12:00:00", 1, 0, 2.09, 0, 1, "されん", 0, 127501, 0, 127501, 3, "【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", 4, 0, 127501, 4, 127501, 304, 0, 450, 0, "2024/04/30 11:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ルカ（サラサリア）", "2023/10/15 15:00:00", 0, 0, 1.965, 0, 1, "るか", 0, 127601, 0, 127601, 3, "【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", 4, 0, 127601, 4, 127601, 157, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ペコリーヌ（クリスマス）", "2024/05/27 12:00:00", 1, 0, 1.965, 0, 2, "ぺこりーぬ", 0, 127901, 0, 127901, 3, "【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", 5, 0, 127901, 5, 127901, 372, 0, 450, 0, "2024/05/31 11:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("クレジッタ（クリスマス）", "2023/12/15 15:00:00", 0, 0, 2.09, 0, 1, "くれじった", 0, 128001, 0, 128001, 3, "【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。", 35, 0, 128001, 35, 128001, 723, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("シズル（シズル&リノ）", "2015/04/01 15:00:00", 1, 0, 0.0, 0, 0, "しずる", 0, 128101, 0, 0, 3, "", 0, 1, 0, 0, 128101, 580, 0, 0, 181101, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("リノ（シズル&リノ）", "2015/04/01 15:00:00", 1, 0, 0.0, 0, 0, "りの", 0, 128201, 0, 0, 3, "", 0, 1, 0, 0, 128201, 580, 0, 0, 181101, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("イノリ（ニューイヤー）", "2023/12/31 12:00:00", 1, 0, 2.09, 0, 1, "いのり", 0, 128301, 0, 128301, 1, "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", 3, 1, 128301, 38, 128301, 191, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ハツネ（ニューイヤー）", "2024/06/26 12:00:00", 1, 0, 2.09, 0, 2, "はつね", 0, 128401, 0, 128401, 3, "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", 7, 0, 128401, 21, 128401, 801, 0, 450, 0, "2024/06/30 11:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("カスミ（ニューイヤー）", "2024/06/26 12:00:00", 1, 0, 2.09, 0, 2, "かすみ", 0, 128501, 0, 128501, 3, "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", 7, 0, 128501, 21, 128501, 739, 0, 450, 0, "2024/06/30 11:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("リリ（フォールン）", "2015/04/01 15:00:00", 1, 0, 0.0, 0, 0, "りり", 0, 128601, 0, 0, 3, "", 1, 0, 0, 1, 128601, 0, 0, 0, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ヒヨリ（アストラル）", "2024/08/12 12:00:00", 1, 0, 2.09, 0, 1, "ひより", 0, 128701, 0, 128701, 3, "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", 1, 0, 128701, 0, 128701, 226, 0, 450, 0, "2024/08/15 14:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("レイ（アストラル）", "2024/01/31 12:00:00", 1, 0, 1.965, 0, 1, "れい", 0, 128801, 0, 128801, 1, "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", 4, 1, 128801, 0, 128801, 194, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ユイ（アストラル）", "2024/08/12 12:00:00", 1, 0, 2.09, 0, 2, "ゆい", 0, 128901, 0, 128901, 3, "【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", 7, 0, 128901, 0, 128901, 772, 0, 450, 0, "2024/08/15 14:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("エリス", "2024/06/30 12:00:00", 1, 0, 2.09, 0, 2, "えりす", 0, 129001, 0, 129001, 3, "【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", 7, 0, 129001, 0, 129001, 800, 0, 450, 0, "2024/07/03 18:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ユニ（ウィンター）", "2024/03/03 19:00:00", 1, 0, 2.09, 0, 1, "ゆに", 0, 129301, 0, 129301, 3, "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", 7, 0, 129301, 7, 129301, 708, 0, 450, 0, "2024/03/11 11:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("クロエ（ウィンター）", "2024/03/18 12:00:00", 0, 0, 2.09, 0, 1, "くろえ", 0, 129401, 0, 129401, 3, "【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", 2, 0, 129401, 2, 129401, 188, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("アネモネ", "2024/06/30 12:00:00", 1, 0, 2.09, 0, 1, "あねもね", 0, 129601, 0, 129601, 3, "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", 0, 0, 129601, 0, 129601, 550, 0, 450, 0, "2024/07/03 18:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ネフィ＝ネラ", "2024/06/30 12:00:00", 1, 0, 2.09, 0, 1, "ねふぃーねら", 0, 129701, 0, 129701, 3, "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", 0, 0, 129701, 0, 129701, 540, 0, 450, 0, "2024/07/03 18:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("マコト（コマンダー）", "2024/03/31 12:00:00", 1, 0, 2.09, 0, 1, "まこと", 0, 129801, 0, 129801, 3, "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", 5, 0, 129801, 5, 129801, 269, 0, 450, 0, "2024/04/12 11:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("エリコ（コマンダー）", "2024/04/15 15:00:00", 0, 0, 1.84, 0, 1, "えりこ", 0, 129901, 0, 129901, 3, "【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", 6, 0, 129901, 48, 129901, 294, 0, 450, 0, "2030/12/31 15:00:00");
