INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("キョウカ（スプリング）", "2024/05/03 19:00:00", 1, 0, 1.92, 0, 2, "きょうか", 0, 130701, 0, 130701, 3, "【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", 7, 0, 130701, 7, 130701, 563, 0, 450, 0, "2024/05/15 14:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("スズメ（スプリング）", "2024/05/15 15:00:00", 0, 0, 1.84, 0, 2, "すずめ", 0, 130801, 0, 130801, 3, "【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", 7, 0, 130801, 7, 130801, 558, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("クルル", "2024/06/15 15:00:00", 0, 0, 2.09, 0, 2, "くるる", 0, 130901, 0, 130901, 3, "【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", 7, 0, 130901, 7, 130901, 440, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("マホ（ドリームパーク）", "2024/05/31 12:00:00", 1, 0, 1.84, 0, 2, "まほ", 0, 131001, 0, 131001, 3, "【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", 7, 0, 131001, 7, 131001, 702, 0, 450, 0, "2024/06/10 11:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ネア（サマー）", "2024/06/30 12:00:00", 0, 0, 2.09, 0, 1, "ねあ", 0, 131101, 0, 131101, 3, "【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", 2, 0, 131101, 52, 131101, 165, 0, 450, 0, "2030/12/31 15:00:00");
