INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ジータ", "2015/04/01 15:00:00", 0, 0, 1.965, 4, 1, "じーた", 0, 170101, 0, 170101, 3, "【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。", 34, 0, 105701, 34, 170101, 245, 0, 450, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ヒヨリ（プリンセス）", "2024/06/30 12:00:00", 1, 0, 1.62, 7, 1, "ひより", 0, 180101, 0, 180101, 3, "【物理】前衛で炎翼を背に敵を粉砕する、陽気な元気娘。\n戦いが続く程に自身の攻撃能力を強めるスキルを操り、\n高めた力で放つ超爆の一撃は、あらゆる敵を塵と化す。", 0, 0, 180101, 0, 180101, 199, 0, 450, 0, "2024/07/03 18:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ユイ（プリンセス）", "2024/06/30 12:00:00", 1, 0, 1.92, 1, 2, "ゆい", 0, 180201, 0, 180201, 3, "【魔法】後衛から極大魔法で敵を滅する願いの魔法士。\nＴＰを回復しつつ攻撃力を累積アップする補助スキルで\n自身の力を高め、強力な範囲攻撃を放ち敵を一掃する。", 0, 0, 180201, 0, 180201, 767, 0, 450, 0, "2024/07/03 18:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("レイ（プリンセス）", "2024/06/30 12:00:00", 1, 0, 1.965, 7, 1, "れい", 0, 180301, 0, 180301, 3, "【物理】中衛で風刃を従え激戦を流麗に征く嵐翼の剣士。\n敵が多い程に効果が高まる自己強化スキルで、自身を奮い\n立たせ、強力な範囲攻撃スキルで一切の敵を鏖滅する。", 0, 0, 180301, 0, 180301, 377, 0, 450, 0, "2024/07/03 18:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ペコリーヌ（プリンセス）", "2024/06/30 12:00:00", 1, 0, 1.965, 1, 1, "ぺこりーぬ", 0, 180401, 0, 180401, 3, "【物理】前衛で、攻防共に絶大な力を誇る腹ペコ王女。\nＨＰが多い時は爆発的な攻撃力で、いかなる敵をも屠り、\nＨＰが減ると自己回復能力を得て、鉄壁の護りを見せる。", 0, 0, 180401, 0, 180401, 155, 0, 450, 0, "2024/07/03 18:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("コッコロ（プリンセス）", "2024/06/30 12:00:00", 1, 0, 2.14, 1, 1, "こっころ", 0, 180501, 0, 180501, 3, "【物理】中衛で、絶大な補助スキルを繰出す純白の巫女。\n味方の攻撃力とクリティカルダメージを強化しつつ、\n二つの全体回復スキルで味方を堅固に守護し勝利へ導く。", 0, 0, 180501, 0, 180501, 555, 0, 450, 0, "2024/07/03 18:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("キャル（プリンセス）", "2024/06/30 12:00:00", 1, 0, 1.92, 1, 2, "きゃる", 0, 180601, 0, 180601, 3, "【魔法】後衛で、極大魔法を操り敵を討つ姫装の猫娘。\n回復や補助を兼ねた各攻撃スキルを駆使し戦況を整え、\n極大威力のユニオンバーストを撃ち込み敵を燼滅する。", 0, 0, 180601, 0, 180601, 747, 0, 450, 0, "2024/07/03 18:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ハツネ＆シオリ", "2024/06/30 12:00:00", 1, 0, 1.75, 1, 1, "はつねしおり", 0, 180701, 0, 180701, 3, "【物理】後衛から、真の絆の力を発揮する仲良し姉妹。\n敵の数が増えるほど威力が高まる攻撃スキルと、周りの\n味方を強化するスキルを操り、立ち塞がる敵を一掃する。", 0, 0, 180701, 0, 180701, 732, 0, 450, 0, "2024/07/03 18:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ミソギ＆ミミ＆キョウカ", "2024/06/30 12:00:00", 1, 0, 1.5, 1, 1, "みそぎみみきょうか", 0, 180801, 0, 180801, 3, "【物理】中衛で敵単体に必殺の一撃を放つ仲良しトリオ。\n３人の力を合わせて放つ攻撃は、相手の弱点に合わせて\n物理から魔法攻撃に変化し、どんな強い敵も退治する！", 0, 0, 180801, 0, 180801, 465, 0, 450, 0, "2024/07/03 18:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("アキノ＆サレン", "2024/06/30 12:00:00", 1, 0, 2.09, 1, 1, "あきのされん", 0, 180901, 0, 180901, 3, "【物理】中衛で背を預けあう最高の好敵手で親友の二人。\n味方の物理攻撃をサポートしつつＨＰとＴＰを継続回復し\nＨＰが多いほど威力が増すＵＢで、共に勝利の道を征く。", 0, 0, 180901, 0, 180901, 421, 0, 450, 0, "2024/07/03 18:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("アン＆グレア", "2024/06/30 12:00:00", 1, 0, 2.09, 1, 2, "あんぐれあ", 0, 181001, 0, 181001, 3, "【魔法】中衛で、魔力共鳴し連撃を放つマナリアの双姫。\nステータスアップ効果を受けると増加する【友情の魔印】\nがスキルを強化し、波長を合わせた炎の魔槍で敵を討つ。", 0, 0, 181001, 0, 181001, 577, 0, 450, 0, "2024/07/03 18:59:59");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("シズル＆リノ", "2024/06/30 12:00:00", 1, 0, 1.92, 1, 1, "しずるりの", 0, 181101, 0, 181101, 3, "【物理】中衛でお揃い衣装の、真偽を超えた仲良し姉妹。\n攻守共に味方を支えるシズルと、クリティカル時に強力な\nダメージを与えるリノ、姉妹の絆で困難を跳ね除ける！", 0, 0, 181101, 0, 181101, 551, 0, 450, 0, "2024/07/03 18:59:59");
